import React from 'react';
import { Grid, Header, Image, Segment } from 'semantic-ui-react';
import data from '../rss_example.json'


function ArticlePresentation() {
    return (
        <Segment raised as='button' onClick={() => console.log("coucou")} textAlign='center' style={{ padding: 'auto'}}>
            <Header>
                {data.title}
            </Header>
            <Image
                src={data.image.url}
                size='medium'
                padded
            />
            <span>
                {data.description}
            </span>
        </Segment>
    )
}

export default ArticlePresentation;
